-- ----------------------------
-- Table structure for activos_activos
-- ----------------------------
DROP TABLE IF EXISTS `activos_activos`;
CREATE TABLE `activos_activos` (
  `idactivo` int(6) NOT NULL AUTO_INCREMENT,
  `idarea` int(3) DEFAULT NULL,
  `idtipo` int(3) DEFAULT NULL,
  `nombrecorto` varchar(40) DEFAULT NULL,
  `descripcion` longtext,
  `fechaalta` datetime DEFAULT NULL,
  `idusuarioalta` int(5) DEFAULT NULL,
  `fechamodificacion` datetime DEFAULT NULL,
  `idusuariomodifica` int(5) DEFAULT NULL,
  `costo` decimal(15,2) DEFAULT NULL,
  `numetiqueta` varchar(13) DEFAULT NULL,
  `claveactivo` varchar(6) DEFAULT NULL,
  `status` char(1) DEFAULT NULL COMMENT 'A = Activo, B = Baja, R = Reparaci√≥n',
  PRIMARY KEY (`idactivo`),
  KEY `FK_activosusuarialta` (`idusuarioalta`),
  KEY `FK_activosusuariomodificacion` (`idusuariomodifica`),
  KEY `FK_activosarea` (`idarea`),
  KEY `FK_activostipo` (`idtipo`),
  CONSTRAINT `FK_activosarea` FOREIGN KEY (`idarea`) REFERENCES `activos_areas` (`idarea`),
  CONSTRAINT `FK_activostipo` FOREIGN KEY (`idtipo`) REFERENCES `activos_tipo` (`idtipo`),
  CONSTRAINT `FK_activosusuarialta` FOREIGN KEY (`idusuarioalta`) REFERENCES `activos_usuarios` (`idusuario`),
  CONSTRAINT `FK_activosusuariomodificacion` FOREIGN KEY (`idusuariomodifica`) REFERENCES `activos_usuarios` (`idusuario`)
) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Table structure for activos_areas
-- ----------------------------
DROP TABLE IF EXISTS `activos_areas`;
CREATE TABLE `activos_areas` (
  `idarea` int(3) NOT NULL AUTO_INCREMENT,
  `idsucursal` int(3) DEFAULT NULL,
  `nombre` varchar(255) DEFAULT NULL,
  `status` char(1) DEFAULT NULL COMMENT 'A = Activo, B = Baja',
  PRIMARY KEY (`idarea`),
  KEY `FK_areasucursal` (`idsucursal`),
  CONSTRAINT `FK_areasucursal` FOREIGN KEY (`idsucursal`) REFERENCES `activos_sucursales` (`idsucursal`)
) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Table structure for activos_baja
-- ----------------------------
DROP TABLE IF EXISTS `activos_baja`;
CREATE TABLE `activos_baja` (
  `idbaja` int(5) NOT NULL AUTO_INCREMENT,
  `idactivo` int(6) DEFAULT NULL,
  `fecha` datetime DEFAULT NULL,
  `idusuariobaja` int(5) DEFAULT NULL,
  `observaciones` varchar(255) DEFAULT NULL,
  `idmotivobaja` int(5) DEFAULT NULL,
  PRIMARY KEY (`idbaja`),
  KEY `FK_bajausuario` (`idusuariobaja`),
  KEY `FK_bajaactivo` (`idactivo`),
  KEY `FK_bajamotivobaja` (`idmotivobaja`),
  CONSTRAINT `FK_bajamotivobaja` FOREIGN KEY (`idmotivobaja`) REFERENCES `activos_motivosbaja` (`idmotivobaja`),
  CONSTRAINT `FK_bajaactivo` FOREIGN KEY (`idactivo`) REFERENCES `activos_activos` (`idactivo`),
  CONSTRAINT `FK_bajausuario` FOREIGN KEY (`idusuariobaja`) REFERENCES `activos_usuarios` (`idusuario`)
) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8;

